		sg.nombre as servicio,
		ns.mensaje, 
		(select concat(primerNombre, ' ', primerApellido) from seg_usuarios u where u.idSegUsuario=ns.idUsuarioEnvio)  as usuarioEnvio, 
		(select concat(primerNombre, ' ', primerApellido) from seg_usuarios u where u.idSegUsuario=ns.idUsuarioRecibe)  as usuarioRecibe ,
		ns.estado 
	FROM 
		ns_notificacion_servicios ns 
		LEFT JOIN
		config_servicios_gerencias sg ON sg.idServiciosGerencias = ns.idServiciosGerencias
		LEFT JOIN config_gerencias g ON g.idConfigGerencia = sg.idGerencia
	
		
	WHERE 
		ns.idUsuarioRecibe=@id and ns.estado=3
	ORDER BY 
		estado, idNotificacionServicio DESC;	

ELSEIF  @accion=2 THEN

	SELECT 
		ns.idNotificacionServicio, 
		DATE_FORMAT(ns.fechaEnvio,'%d %b %Y   %H:%i:%s') as fechaEnvio,
		DATE_FORMAT(ns.fechaLectura,'%d %b %Y   %H:%i:%s"') as fechaLectura,
