CREATE DEFINER=`root`@`localhost` PROCEDURE `insertarItemMenu` (IN `idHijo` INT, IN `idPadre` INT, IN `titulo` VARCHAR(45), IN `rLink` VARCHAR(45), IN `nivel` INT, IN `ordVisual` INT, IN `expIcon` CHAR(50), IN `coIcon` VARCHAR(50))  BEGIN


SET @idSegMenu = idHijo;
SET @idPadre = idPadre;
SET @titulo = titulo;
SET @routeLink = rLink;
SET @nivel= nivel;
SET @orden= ordVisual;
SET @expandedIcon = expIcon;
SET @collapsedIcon = coIcon;


IF IFNULL(@idPadre, 0) = 0 THEN

	SET @idPadre = 0;
	SET @nivel = 1;
	SET @orden = 1;
	
	
ELSE
	
	
	IF EXISTS (SELECT idSegMenu from seg_menus where idSegMenuPadre=@idPadre) THEN
	
		/*tiene hijos*/

		
		SELECT  @orden:=max(ordenVisualizacion) from seg_menus where idSegMenuPadre = @idPadre;
		
		SELECT @nivel:=nivel from seg_menus where idSegMenu = @idPadre;
		
		SET @orden = @orden + 1;
		SET @nivel = @nivel + 1;
		
		
		SELECT 'tiene hijos', @orden,  @nivel;
		
	ELSE
		
		SELECT @orden:= ordenVisualizacion, @nivel:= nivel from seg_menus where idSegMenu = @idPadre;
		
		SET @orden = @orden + 1;
		SET @nivel = @nivel + 1;
		
		SELECT 'No tiene hijos', @orden,  @nivel;
	

	END IF;

	
END IF;


	idSegMenuPadre,
	titulo,
	routeLink,
	nivel,
	ordenVisualizacion,
	expandedIcon,
	collapsedIcon
)
VALUES 
(
	@idPadre,
  	@titulo,
  	@routeLink,
  	@nivel,
  	@orden,
  	@expandedIcon,
  	@collapsedIcon
);

	


END$$

