CREATE DEFINER=`root`@`%` PROCEDURE `obtenerBreadCrumb` (IN `idMenu` INT)  BEGIN


SET @id = idMenu;



		SELECT idSegMenu, (@id:=idSegMenuPadre ) as idSegMenuPadre , titulo as label
		FROM 
		    ( SELECT sm.idSegMenu, sm.idSegMenuPadre, sm.titulo
