CREATE DEFINER=`root`@`localhost` PROCEDURE `obtenerMenuPorUsuario` (IN `idUsuario` INT)  BEGIN

DECLARE done INT DEFAULT FALSE;
DECLARE id INT;
DECLARE cur1 CURSOR FOR SELECT idSegMenu FROM idMenus;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

SET @idUsuario = idUsuario;



CREATE TEMPORARY TABLE  
	menu (
				idSegMenu INT, 
				idSegMenuPadre INT, 
				titulo VARCHAR(45), 
				routeLink  VARCHAR(45),
				nivel INT, 
				ordenVisualizacion VARCHAR(5),
				expandedIcon  VARCHAR(50),
				collapsedIcon  VARCHAR(50)
			) ENGINE=MEMORY;

CREATE TEMPORARY TABLE idMenus ENGINE=MEMORY AS (

	SELECT DISTINCT idSegMenu 
	FROM 
	(
		SELECT 
			sr.idSegMenu
		FROM 
			seg_perfiles_usuarios spu INNER JOIN seg_roles_perfiles srp ON spu.idSegPerfil = srp.idSegPerfil
			INNER JOIN seg_roles sr ON sr.idSegRol = srp.idSegRol
		WHERE 
			spu.idSegUsuario = @idUsuario and sr.idSegRol is NOT NULL
		UNION 
		SELECT
		 sr.idSegMenu
		FROM 
			seg_roles_usuarios sru INNER JOIN seg_roles sr ON sr.idSegRol = sru.idSegRol
		WHERE 
			sru.idSegUsuario = @idUsuario and sr.idSegRol is NOT NULL
	) AS menus
	WHERE idSegMenu is not null
);

OPEN cur1;
read_loop: LOOP
    FETCH cur1 INTO id;
    
    IF done THEN
      LEAVE read_loop;
    END IF;
    
		SET @id = id;
   
		/*SELECT idSegMenu, (@id:=idSegMenuPadre ) as idSegMenuPadre , titulo, routeLink, nivel, ordenVisualizacion, expandedIcon, collapsedIcon
		FROM 
		    ( SELECT sm.idSegMenu, sm.idSegMenuPadre, sm.titulo, sm.routeLink, sm.nivel, sm.ordenVisualizacion, sm.expandedIcon, sm.collapsedIcon
		      FROM seg_menus sm
		      ORDER BY sm.idSegMenuPadre DESC
		    ) AS aux_table 
		WHERE idSegMenu = @id
		ORDER BY idSegMenuPadre;*/
				SELECT T2.idSegMenu, T2.idSegMenuPAdre, T2.titulo, T2.routeLink, T2.nivel, T2.ordenVisualizacion, T2.expandedIcon, T2.collapsedIcon
		FROM (
		    SELECT
		        @r AS _id,
		        (SELECT @r := idSegMenuPadre FROM seg_menus WHERE idSegMenu = _id) AS parent_id,
		        @l := @l + 1 AS lvl
		    FROM
		        (SELECT @r := @id, @l := 0) vars,
		        seg_menus m
		    WHERE @r <> 0) T1
		JOIN seg_menus T2
		ON T1._id = T2.idSegMenu
		ORDER BY T1.lvl DESC;
   
  END LOOP;

CLOSE cur1;

SELECT DISTINCT * FROM menu order by ordenVisualizacion;
DROP TABLE idMenus;
DROP TABLE menu;


END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `obtenerRolesLocalStorage` (IN `idUser` INT)  BEGIN
set @idUser = idUser;




SELECT DISTINCT * 
	FROM 
	(
SELECT 
	sr.*
FROM 
	seg_perfiles_usuarios spu INNER JOIN seg_roles_perfiles srp ON spu.idSegPerfil = srp.idSegPerfil
	INNER JOIN seg_roles sr ON sr.idSegRol = srp.idSegRol
WHERE 
	spu.idSegUsuario = @idUser 
UNION 
SELECT
	sr.*
FROM 
	seg_roles_usuarios sru INNER JOIN seg_roles sr ON sr.idSegRol = sru.idSegRol
WHERE 
	sru.idSegUsuario = @idUser
	) AS rolAux
	order by idSegRol;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `registrarNotificacion` (IN `mensaje` VARCHAR(2000), IN `idServGer` INT, IN `idRol` INT, IN `idUserEnv` INT)  BEGIN

SET @mensaje = mensaje;
SET @idServGer = idServGer;
SET @idRol = idRol;
SET @idUserEnv = idUserEnv;


CREATE TEMPORARY TABLE usuariosRecibe ENGINE=MEMORY AS (

	SELECT DISTINCT idSegUsuario 
	FROM 
	(
		/*SELECT  pu.idSegUsuario FROM seg_roles r INNER JOIN seg_roles_perfiles rp ON rp.idSegRol=r.idSegRol
		INNER JOIN seg_perfiles_usuarios pu ON pu.idSegPerfil = rp.idSegPerfil
		WHERE r.idSegRol = @idRol

		UNION 

		SELECT ru.idSegUsuario FROM seg_roles r INNER JOIN seg_roles_usuarios ru ON ru.idSegRol = r.idSegRol
		WHERE r.idSegRol = @idRol*/
		
	SELECT DISTINCT su.idSegUsuario FROM config_servicios_gerencias csg INNER JOIN config_cargos cc ON cc.idConfigGerencia=csg.idGerencia
	INNER JOIN seg_usuarios su ON su.idConfigCargo = cc.idConfigCargo
	WHERE csg.idServiciosGerencias=@idServGer
	
	) AS usuarios
);

IF EXISTS ( SELECT idSegUsuario FROM usuariosRecibe) THEN

	SELECT @mensaje, @idServGer, @idRol, @idUserEnv, idSegUsuario FROM usuariosRecibe;
	
	SELECT LAST_INSERT_ID() AS id, 'Se registro satisfactoriamente la notificación' as msj;
ELSE
	
	SELECT '-1' AS id, 'No se pudo regitrar la notificación' as msj;
END IF;

drop table usuariosRecibe;

END$$

